import React from 'react'
import ProjectCard from 'components/ProjectCard'
import grape from 'static/cards/grapelogo.png'

const projects = [
  {
    link: 'Grape',
    image: grape,
    header: 'do something nice today.',
    description: 'Mobile web application designed to encourage users to track personal acts of kindness',
  }
]

function Projects() {
  const projectCards = projects.map(project => {
    return (
      <ProjectCard 
        link={project.link}
        image={project.image}
        header={project.header}
        description={project.description}
      />
    )
  })

  return (
    <section className='portfolio'>
      <div className='container'>
        <hr/>
        <div className='row media__container'>
          {projectCards}
        </div>
      </div>
    </section>
  )
}

export default Projects
